import { useRouter } from 'next/router';
import useSWR from 'swr';


function fetcher(url) {
  return fetch(url).then(r => r.json());
}

export default function Index() {
  const { query } = useRouter();
  const { data, error } = useSWR('/api/tarot', fetcher);
  // The following line has optional chaining, added in Next.js v9.1.5,
  // is the same as `data && data.name`
  const name = data?.name;
  let number = data?.number;
  let fortune = data?.fortune_telling
  console.log(fortune)
  let keywords = data?.keywords
  console.log(keywords)
  let image = data?.img
  if (!data) number = 'Loading...';
  if (error) number = 'Failed to fetch a card.';

  let fortuneList = []
  for (var x in fortune) {
    fortuneList.push(<p key={x}>{fortune[x]}</p>)
  }
  console.log(fortuneList)

  let keywordList = []
  for (var y in keywords) {
    keywordList.push(<li key={y}>{keywords[y]}</li>)
  } 


  return (
    <div className="container mx-auto px-4">
    <main className="">
      <img src={image} />
      <div className="text-2xl">{number}</div>
      {number && <span className="name">{name}</span>}
      <div className="">{fortuneList}</div>
      <div className="">Keywords:{keywordList}</div>
    </main>
    </div>
  );
}
